import { Fragment } from "react";

export default function Index() {
  return (
    <Fragment>
      <section className="container">
        <div className="game-container">
          <div className="game">
            <div className="webcam-black border" />
            <div className="chess-board" />
            <div className="webcam-white" />
          </div>
          <div className="game" />
          <div className="game" />
          <div className="game" />
          <div className="game" />
        </div>
      </section>
      <style jsx>
        {`
          .container {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
          }

          .game-container {
            display: flex;
            justify-content: center;
            align-items: center;
          }

          .game {
            margin: 5px;
            min-width: 150px;
            min-height: 150px;
            border: 1px black solid;
          }

          .game * {
            border: 1px black solid;
          }

          .webcam-black {
            min-width: 100px;
            min-height: 100px;
          }
        `}
      </style>
    </Fragment>
  );
}
